import { useEffect, useState } from "react";
import StatusLine from "../task/StatusLine";
import '../../styles/Components/equip.scss'
import Axios from "axios";
import validator from 'validator'
import Swal from 'sweetalert2'
import { Card, FormControl, InputGroup } from "react-bootstrap"
import { useParams } from "react-router-dom";

export const Equip = () => {

  const [correo, setcorreo] = useState("")
  const {nameproy} = useParams();

  useEffect(() => {
    Axios.post("http://localhost:9000/equipo/cargo/")
                .then(res => {
                    console.log(res)
                })
                .catch(err => {
                    Swal.fire('Error', 'Error', 'error')
                })
  }, [])


  return (
    <>
      <div align="center">
        <Card
          bg="dark"
          text="white"
        >
          <Card.Header as="h5">Equipo: {nameproy}</Card.Header>
          <Card.Body>
            <h4>Agrega usuarios al Equipo</h4>
            <Card.Title>
              <InputGroup className="mb-3" style={{ width: 350 }}>
                <InputGroup.Text>Cor_Usuario</InputGroup.Text>
                <FormControl aria-label="correo User"
                  onChange={(e) => {
                    setcorreo(e.target.value);
                  }}
                />
              </InputGroup>
            </Card.Title>
            <Card.Text>
              <button className='btn btn-prime btn-block'>
                Agregar
              </button>

            </Card.Text>
          </Card.Body>
        </Card>
      </div>


    </>
  );
}
